import { Route, Router, Routes ,} from 'react-router-dom';
import './App.css';
import { Threads } from './Threads/Threads';


function App() {
  return (
    <div>
      <header className="App-header">
        <h2 className='sign'>掲示板</h2>
        <Router>
        <Routes>
          <Route path="/" element={<Threads />} />
        </Routes>
        </Router>
      </header>
    </div>
  );
}

export default App;
